import React from 'react';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import './App.scss';

const theme = createMuiTheme({
    palette: {
    primary: {
        main: green[500],

    },
    type:'dark'
    },

  });

const Nav = () =>(
    <ThemeProvider theme={theme}>
    <Paper>
    <ul>
    <li>Home</li>
    <li>Contact</li>
    <li></li>
    <li></li>    
    </ul>
    </Paper>
    </ThemeProvider>
    )
    export default Nav;
